import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'
import { GlobalStateProvider} from './utils/useGlobalState'
import Home from './components/home'
import GridCreator from './components/new'


function App() {
  return (
    <GlobalStateProvider>
      <Router basename='/'>
        <Routes>
          <Route exact path="/" element={<Home/>} />
          <Route exact path="/new" element={GridCreator} />
          {/*<Route exact path="/grid/:uid" component={GridViewer} />
          <Route exact path="/grid/:uid/edit" component={GridEditor} />*/}
        </Routes>
      </Router>
    </GlobalStateProvider>
  );
}

export default App;
